import { useState } from 'react';
import { Col, Container, Nav, Navbar, Row } from 'react-bootstrap'; //
import './App.css';
import data from './data.js';

function App() {
    let [art] = useState(data);

    return (
        <div className='App'>
            <Navbar bg='light' variant='light' className='Navbar'>
                <Container>
                    <Navbar.Brand href='#home'>일시불</Navbar.Brand>
                    <Nav className='me-auto' className='Navi'>
                        <Nav.Link href='#home'>홈</Nav.Link>
                        <Nav.Link href='#features'>찾아보기</Nav.Link>
                        <Nav.Link href='#pricing'>더보기</Nav.Link>
                    </Nav>
                </Container>
            </Navbar>
            <div className='Main-bg'></div>

            <Container>
                <Row className='row'>
                    {/* <Col className='col-top-1'>
                        <img src={art[0].src} width='80%' height='65%' />
                        <h4>{art[0].title}</h4>
                        <p>{art[0].content}</p>
                    </Col>
                    <Col className='col-top-1'>
                        <img src={art[1].src} width='80%' height='65%' />
                        <h4>{art[1].title}</h4>
                        <p>{art[1].content}</p>
                    </Col>
                    <Col className='col-top-1'>
                        <img src={art[2].src} width='80%' height='65%' />
                        <h4>{art[2].title}</h4>
                        <p>{art[2].content}</p>
                    </Col> */}
                    {art.map(function (i) {
                        return (
                            <Col className='col-top-1'>
                                <img
                                    src={art[1].src}
                                    width='80%'
                                    height='65%'
                                />
                                <h4>{art[1].title}</h4>
                                <p>{art[1].content}</p>
                            </Col>
                        );
                    })}

                    {/* <MidArt art={art}></MidArt>
                    <MidArt art={art}></MidArt>
                    <MidArt art={art}></MidArt> */}
                </Row>
            </Container>
        </div>
    );
}
function MidArt(props) {
    return (
        <Col className='col-top-1'>
            <img src={props.art[0].src} width='80%' height='65%' />
            <h4>{props.art[0].title}</h4>
            <p>{props.art[0].content}</p>
        </Col>
    );
}

export default App;
